import { createContext, useState } from "react";

const[navbarLinks, setNavbarLinks] = useState({
    name: "FORUM JAB", 
    links: [
        {name: "login", page: "/login"},
        {name: "register", page: "/register"},
    ]
});
export const NavbarContext = createContext(navbarLinks);
